import React, { Component } from "react";
import { Link } from "react-router-dom";
//mport defaultProfile from "../images/useravatar.png";

class ProfileTabs extends Component {
  render() {
    const { following, followers, posts } = this.props;
   // console.log(posts)
    return (
      <div className="profile-stats">
        <li>
          <div className="profile-stat-count">
            <h3 className="text-dark">{followers.length} followers</h3>
          </div>
          </li>

          <li>
          <div className="profile-stat-count">
            <h4 className="text-dark">{following.length} following</h4>
          </div>
          </li>

          <li>
          <div className="profile-stat-count">
            <h5 className="text-dark">{posts.length} Post</h5>
          </div>
          </li>

      </div>


    );
  }
}

export default ProfileTabs;
